WillClosed = [False]

class ReceiveClipboardText(QObject):
    textSignal = Signal(str)
    def __init__(self):
        QObject.__init__(self)
        threading.Thread(target=self.run, daemon=True).start()

    def run(self):
        asyncio.run(self.setClip())

    async def setClip(self):
        try:
            self.s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
            self.s.bind(('0.0.0.0', 50618))
            self.s.listen(100)
            while not WillClosed[0]:
                full_data = b''
                Loop = True
                (insock, _) = self.s.accept()
                while Loop:
                    try:
                        data = insock.recv(1073741824)
                        if len(data) <= 0:
                            Loop = False
                        else:
                            full_data += data
                    except:
                        pass
                self.textSignal.emit(full_data.decode('utf-8'))
                time.sleep(0.89)
        except:
            pass

class SendText(object):
    def __init__(self, host, text):
        self.host = host
        try:
            try:
                asyncio.run(self.send(text))
            except:
                pass
        except:
            pass

    async def send(self, text):
        _, writer = await asyncio.open_connection(self.host, 50618)
        writer.write(text.encode('utf-8'))
        await writer.drain()
        writer.close()
        await writer.wait_closed()

class MainWindowwView(QMainWindow):
    def __init__(self, parent=None):
        super(MainWindowwView, self).__init__(parent)
        self.setAcceptDrops(True)
        self.setWindowIcon(QIcon(QPixmap(QSize(512, 512)).fromImage(QImage.fromData(QByteArray.fromBase64(
            b'')))))

    def closeEvent(self, event):
        WillClosed[0] = True

class HistoryURLEditModel(QStandardItemModel):
    def __init__(self, parent=None):
        super(HistoryURLEditModel, self).__init__(parent)

    def search(self, _):
        self.clear()
        try:
            if os.path.exists(os.path.join(os.path.expanduser('~'), '.CLipShareSetting', 'setting.txt')):
                data = json.load(open(os.path.join(os.path.expanduser('~'), '.CLipShareSetting', 'setting.txt'), 'r', encoding='utf-8'))
            else:
                os.makedirs(os.path.join(os.path.expanduser('~'), '.CLipShareSetting'), exist_ok=True)
                with open(os.path.join(os.path.expanduser('~'), '.CLipShareSetting', 'setting.txt'), 'w', encoding='utf-8') as f:
                    f.write('')
                try:
                    data = json.load(open(os.path.join(os.path.expanduser('~'), '.CLipShareSetting', 'setting.txt'), 'r', encoding='utf-8'))
                except:
                    data = {}
            [self.appendRow(QStandardItem(row)) for _, row in data.items()]
        except:
            pass

class AutoComplete(QCompleter):
    def __init__(self, parent=None):
        super(AutoComplete, self).__init__(parent)

    def splitPath(self, path: str):
        self.model().search(path)
        return super(AutoComplete, self).splitPath(path)

